import React from 'react';
import './TimelineSection.css';

const TimelineSection = () => {
  const timelineData = [
    {
      date: '2020',
      title: 'Company Founded',
      description: 'Our journey began with a vision to revolutionize the industry and provide innovative solutions to our clients.'
    },
    {
      date: '2021',
      title: 'First Major Project',
      description: 'Successfully completed our first major project, establishing ourselves as a reliable partner in the market.'
    },
    {
      date: '2022',
      title: 'International Expansion',
      description: 'Expanded our operations to international markets, serving clients across multiple continents.'
    },
    {
      date: '2023',
      title: 'Innovation Award',
      description: 'Received recognition for our innovative approach and commitment to excellence in the industry.'
    },
    {
      date: '2024',
      title: 'Future Vision',
      description: 'Continuing to grow and innovate, with plans for further expansion and development of new services.'
    }
  ];

  return (
    <section className="timeline-section" id="timeline">
      <div className="timeline-container">
        <div className="timeline-header">
          <h2>Our Journey</h2>
          <p>
            From our humble beginnings to becoming a leading provider in the industry,
            we've come a long way. Here's a look at our key milestones and achievements.
          </p>
        </div>

        <div className="timeline">
          {timelineData.map((item, index) => (
            <div key={index} className="timeline-item">
              <div className="timeline-content">
                <div className="timeline-date">{item.date}</div>
                <h3 className="timeline-title">{item.title}</h3>
                <p className="timeline-description">{item.description}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default TimelineSection;
